;; **
;;; # Evaluating the near-spea2 algorithm
;;; 
;;; I've made a simplification in the implementation of spea2 in algebolic. In the archive thinning step,  the spea2 prescription is sorting on nearest neighbour distance, and then breaking ties on second neighbour distance, third etc, going as far as is needed to find a unique individual. I instead calculate the N nearest neighbour distances and do a lexicographic sort by these distances. This is equivalent to the spea2 algorithm unless there are individuals tied on more than N neighbour distances, in which case my implementation effectively chooses at random. By increasing N to be the size of the archive we get the behaviour of the spea2 thinner (although very inefficiently). This worksheet takes a look at whether using N=5, for an archive size of 100, makes any difference than using N=100.
;;; 
;;; The code below needs to be re-run manually with the different configurations. Skip to the graphs at the end for the results.
;; **

;; @@
(ns algebolic.near-spea-comparison
  (:require [gorilla-plot.core :as plot]
            [algebolic.expression.core :as expression]
            [algebolic.expression.genetics :as genetics]
            [algebolic.expression.score :as score]
            [algebolic.expression.tree :as tree]
            [algebolic.evolution.core :as evolution]
            [algebolic.evolution.metrics :as metrics]
            [algebolic.evolution.reproduction :as reproduction]
            [algebolic.evolution.scoring :as scoring]
            [algebolic.evolution.selection :as selection]
            [algebolic.evolution.transform :as transform]
            [algebolic.evolution.pareto :as pareto]
            [algebolic.algorithms.spea2 :as spea2]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def xs (range 0.0 30.0 1.0))
(def coords (mapv (fn [x] [x]) xs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.near-spea-comparison/coords</span>","value":"#'algebolic.near-spea-comparison/coords"}
;; <=

;; @@
(def data (map (fn [x] (- (+ (* 2 x) (* 3 x x)) (* 0.09 x x x))) xs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.near-spea-comparison/data</span>","value":"#'algebolic.near-spea-comparison/data"}
;; <=

;; @@
(def data (map (fn [x] (Math/sin (/ x 4))) xs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.near-spea-comparison/data</span>","value":"#'algebolic.near-spea-comparison/data"}
;; <=

;; @@
(def vars '[x])
(def functions (expression/get-functions #{:plus :minus :times}))
(def terminals (expression/terminal-generators vars))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.near-spea-comparison/terminals</span>","value":"#'algebolic.near-spea-comparison/terminals"}
;; <=

;; @@
(defn generation-config
  []
  (let [size-limit 80
        min-size 15
        ea-config (spea2/spea2-config
                    {:goals [:error :complexity]
                     :comparison-depth 5
                     :archive-size 100
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 45}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation functions terminals 3) :repeat 10}]})
        score-functions {:complexity tree/count-nodes
                         :error (fn [ex] (score/abs-error vars coords data ex))}]
    {:ea-config              ea-config
     :transformations        [(partial transform/apply-to-fraction-of-genotypes
                                       (partial transform/hill-descent
                                                genetics/twiddle-constants
                                                (:error score-functions))
                                       0.5)
                              (partial transform/apply-to-all-genotypes
                                       (partial genetics/trim-hard size-limit))
                              (partial transform/apply-to-all-genotypes
                                       (partial genetics/boost-hard min-size
                                                #(genetics/random-full-tree functions terminals 3)))]
     :score-functions        score-functions
     :stopping-condition     #(>= (:age %) 50)
     :reporting-function     (fn [z] (print ".") (flush))}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.near-spea-comparison/generation-config</span>","value":"#'algebolic.near-spea-comparison/generation-config"}
;; <=

;; @@
(def initial-zeitgeist
  (evolution/make-zeitgeist (genetics/full-population functions terminals 100 5)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.near-spea-comparison/initial-zeitgeist</span>","value":"#'algebolic.near-spea-comparison/initial-zeitgeist"}
;; <=

;; @@
(defn get-pareto-coords
  []
  (map (fn [i] [(:error i) (:complexity i)])
       (pareto/non-dominated-individuals
         [:error :complexity]
         (:elite (evolution/run-evolution (generation-config) initial-zeitgeist)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.near-spea-comparison/get-pareto-coords</span>","value":"#'algebolic.near-spea-comparison/get-pareto-coords"}
;; <=

;; @@
(def spea2-coords (doall (repeatedly 10 get-pareto-coords)))
